import React from 'react';
import './ChiptuningBlock.css';

const ChiptuningBlock: React.FC = () => {
  return (
    <section id="chiptuning" className="chiptuning">
      <div className="chiptuning__content">
        <h2 className="chiptuning__title">Chiptuning</h2>
        <div className="chiptuning__underline"></div>
        <p className="chiptuning__text">
          La <strong>RURIC Service S.R.L.</strong> oferim servicii profesionale de
          <em> chiptuning</em> pentru îmbunătățirea performanțelor și eficienței.
        </p>

        <ul className="chiptuning__list">
          <li>Chiptuning la motor (creștere putere, cuplu, optimizare consum)</li>
          <li>Chiptuning pentru cutii automate (schimbări mai line și mai rapide)</li>
          <li>Testare și diagnoză completă după rescriere</li>
          <li>Reducere consum combustibil</li>
          <li>Adaptări personalizate în funcție de model</li>
        </ul>
      </div>
    </section>
  );
};

export default ChiptuningBlock;
